import { Icon as FeatherIcon } from 'react-feather';
import { Icon as FontAwesomeIcon } from '@fortawesome/fontawesome-svg-core';
import Link from 'next/link';

const NAV_LINKS: {
	name: string;
	link: string;
	icon?: FeatherIcon | FontAwesomeIcon;
}[] = [
	{ name: 'Dashboard', link: '/' },
	{ name: 'Modules', link: '/modules' },
	{ name: '', link: '/Logs' },
];

const Sidebar = () => {
	return (
		// <div className="bg-secondary-bg h-full p-6" style={{ width: '15%' }}></div>
		<div className="p-3" style={{ width: '15%', height: '100%' }}>
			<ul>
				{NAV_LINKS.map((navLink) => {
					return (
						<li className="py-2 px-3">
							<Link href={navLink.link}>{navLink.name}</Link>
						</li>
					);
				})}
			</ul>
		</div>
	);
};

export default Sidebar;
